import { Box } from "@mui/system";
import React from "react";
import "./Quote.css";
const Quote = () => {
  return (
    <div className="bgg">
      <Box
        className="bg"
        style={{
          height: "70px",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h3>KIDDOS TRADEZZ , where imagination has no limits</h3>
      </Box>
    </div>
  );
};

export default Quote;
